  true,\n\t\"url\": null,\n\t\"notes\": \"This investment represents the integration
  of FHWAX044 Motor Fuel SMART Input Tool and FHWAX062 FASH, resulting in a combined
  investment FHWAX102. It will enable states to enter or import data from various
  FHWA forms for reporting motor fuel and highway financial data. It is also used
  to produce annual reports for Highway Statistics. The basic functionality has existed
  since the first Highway Bill in 1956. Motor fuels data has been used in the apportionment
  process since 1982.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
